// src/components/SportsList.js
import React from 'react';

const SportsList = ({ sports }) => {
  console.log('Sports List Data:', sports); // Debugging statement

  if (sports.length === 0) {
    return <p>No sports available</p>;
  }

  return (
    <ul>
      {sports.map((sport, index) => (
        <li key={index}>{sport.title}</li>
      ))}
    </ul>
  );
};

export default SportsList;
